script: |
  super -f text -I q4814.spq | sort > q4814.out

inputs:
  - name: q4814.spq
    data: |
      SELECT + col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 * 10 NOT IN ( + col0 * - - 31 + col2, col1 + col1 - 38 );
  - name: tab0

outputs:
  - name: q4814.out
    data: |
      1
      21
      81
